import React from "react";
import { Flex, Text } from "rebass";
import Button from "./components/Button";

const App = () => {
  return (
    <Flex
      flexDirection="column"
      width="100%"
      justifyContent="center"
      alignItems="center"
    >
      <Button variant="primary">Resources</Button>
      <Button variant="primary">Instagram</Button>
      <Button variant="primary">Linkedin</Button>
      <Button variant="action">Click me</Button>
    </Flex>
  );
};

export default App;
